window.bookSummaryJSON = "<p>Building on the core works of <i>The Rational Male</i>, <i>Preventive Medicine</i> presents a poignant outline of the phases of maturity and the most commonly predictable experiences men can expect from women as they progress through various stages of life. Rational and pragmatic, the book explores the inter-gender and social dynamics of each stage of women's maturity and provides a practical understanding for men in dealing with women in those phases. </p> <p><i>Preventive Medicine</i> also provides revealing outlines of feminine social primacy, Hypergamy, the \"Hierarchies of Love\", and the importance of understanding the conventional nature of complementary masculinity in a world designed to keep men ignorant of it. </p> <p><i>The Rational Male - Preventive Medicine</i> seeks to help men who \"wish they knew then what they know now\". The book is the first in of series complements to The Rational Male, the 12-year core writing of author/blogger Rollo Tomassi from therationalmale.com. Rollo Tomassi is one of the leading voices in the globally growing, male-focused online consortium known as the \"Manosphere\". </p> <p><b>PLEASE NOTE: When you purchase this title, the accompanying reference material will be available in your My Library section along with the audio.</b> </p>"; 
